def eng_to_chn(sentence):
  encoder_input_ids = tokenizer(sentence, return_tensors="pt").input_ids
  out=model.generate(encoder_input_ids) # 1 x N tensor
  ans = [tokenizer.decode(t, skip_special_tokens=True) for t in out]
  return ans

def chn_to_eng(sentence):
  encoder_input_ids = tokenizer2(sentence, return_tensors="pt", padding=True).input_ids
  out=model2.generate(encoder_input_ids)
  return [tokenizer2.decode(t, skip_special_tokens=True) for t in out]

